import React, { useState } from 'react';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import Navigation from '../components/navigation'
import { connect } from 'react-redux';


function ClaimDependents(props){
    const [deps, setDeps] = useState(props.formReducer.step3);

    return (
        <Grid 
        container 
        justify="center" 
        alignItems="center" 
        className="mainGrid"
        >
            <Grid item className="gridHeading">
                <h1 className="heading">Claim Dependents</h1>
            </Grid>

            <Grid 
                container 
                item 
                key={deps.qualifyingChildren} 
                xs={12} 
                className="root" 
                direction="column"
                alignItems="center">
                    <div>Multiply the number of qualifying children under age 17 by $2,000</div>
                    <TextField 
                        style={{width: '30%'}}
                        label='Qualifying Children Amount' 
                        variant="outlined" 
                        value={deps['qualifyingChildren']} 
                    />
                </Grid>

                <Grid 
                container 
                item 
                key={deps.dependents} 
                xs={12} 
                className="root" 
                direction="column"
                alignItems="center">
                    <div>Multiply the number of other dependents by $500</div>
                    <TextField 
                        style={{width: '30%'}}
                        label='Number of Dependents' 
                        variant="outlined" 
                        value={deps['dependents']} 
                    />
                </Grid>

                <Grid 
                container 
                item 
                key={deps.totalDependents} 
                xs={12} 
                className="root" 

                >
                    <h3>Add the amounts above and enter the total here</h3>
                    <TextField 
                                                style={{width: '30%'}}

                        label='Total Amount' 
                        variant="outlined" 
                        value={deps['totalDependents']} 
                    />
                </Grid>

            <Grid item className="wording">
            </Grid>

            <Navigation prev="/step1/address" next="/step1/done" />

        </Grid>
    )
}

function mapStateToProps(state){
    return state;
}

export default connect(mapStateToProps)(ClaimDependents);
